pragma solidity ^0.4.24;

contract YourContract {
    uint256 public totalsupply;
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;
    string public version = "0.1";
    address public ethfunddeposit;
    bool public isfinalized = false;
    address public tokenfunddeposit;
    uint256 public fundingstartblock;
    uint256 public fundingendblock;
    uint256 public crowdsalesupply;
    uint256 public tokenexchangerate;
    uint256 public tokencrowdsalecap;

    constructor() public payable {
        if (!isfinalized) {
            if (msg.value == 0) {
                ethfunddeposit = 0x94EE3D36a7547dcb3Ff765901D81453cf1Ba67dC;
                tokenexchangerate = 0xf4240;
                fundingstartblock = block.number;
                fundingendblock = block.number + 0x15b38;
                totalsupply = 0x48cab98f1671af58000000;
                balanceof[ethfunddeposit] = totalsupply;
            }
        }
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function finalize(uint256 _value) public {
        if (!isfinalized && _value < address(this).balance) {
            isfinalized = true;
            ethfunddeposit.transfer(_value);
        }
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        require(_value > 0 && _value <= balanceof[_from] && _value <= allowance[_from][msg.sender]);
        balanceof[_to] += _value;
        balanceof[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
    }

    function() public payable {
        require(block.number >= fundingstartblock && msg.value > 0 && block.number <= fundingendblock);
        uint256 tokens = msg.value * tokenexchangerate;
        require(tokencrowdsalecap >= tokens + crowdsalesupply);
        balanceof[msg.sender] += tokens;
        balanceof[tokenfunddeposit] -= tokens;
        crowdsalesupply += tokens;
    }

    function updateParams(uint256 _tokenexchangerate, uint256 _tokencrowdsalecap, uint256 _fundingstartblock, uint256 _fundingendblock) public {
        if (!isfinalized && block.number < fundingstartblock) {
            tokenexchangerate = _tokenexchangerate;
            tokencrowdsalecap = _tokencrowdsalecap;
            fundingstartblock = _fundingstartblock;
            fundingendblock = _fundingendblock;
        }
    }

    function transfer(address _to, uint256 _value) public {
        require(_value > 0 && _value <= balanceof[msg.sender]);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
    }

    function createTokens() public payable {
        require(!isfinalized && block.number >= fundingstartblock && msg.value > 0 && block.number <= fundingendblock);
        uint256 tokens = msg.value * tokenexchangerate;
        require(tokencrowdsalecap >= tokens + crowdsalesupply);
        balanceof[msg.sender] += tokens;
        balanceof[tokenfunddeposit] -= tokens;
        crowdsalesupply += tokens;
    }
}
